import React from 'react';
import 'bootswatch/dist/vapor/bootstrap.css';


export default class TelaLinhaSalva extends React.Component {

    render() {
        return (
            <div>
                <div className="card text-white bg-primary mb-3" style={this.style.width}>
                    <div className="card-header">Projeto JF Bordados</div>
                    <div className="card-body">
                        <h4 className="card-title">Linha Salva</h4>
                        <p className="card-text">Logo do IF frente:
                        <br/> Cores: Verde-2233, Vermelho -7655
                         </p>
                    </div>
                </div>

                <div className="card text-white bg-primary mb-3" style={this.style.width}>
                    <div className="card-header">Projeto JF Bordados</div>
                    <div className="card-body">
                        <h4 className="card-title">Bordado Salvo</h4>
                        <p className="card-text">Site do IF costas:
                        <br/> Cores: Verde-2233, Vermelho -7655
                         </p>
                    </div>
                </div>
            </div>
        )
    }

    style = {
        width: {
            position: 'relative',
            left: '10px'
        }
    }

}
